    description:
      "<p>Signs advising travelers of UC Irvine's ZotRadio are posted on traffic poles. The radio system's primary function is to provide traffic conditions and alerts and emergency news and information should the campus experience a natural or manmade disaster or other emergency that would require quick dissemination of information and action by the campus community. In the case of an emergency or Zotalert, the radio may broadcast information about evacuation instructions, shelter-in-place, or other directives related to the alert. The station broadcasts 24 hours a day, seven days a week.</p>\n<p>&nbsp;</p>\nEmergency Alert Signage at Intersections:   \n<ul>\n<li>East Peltason Drive and Pereira</li>\n<li>East Peltason Drive and Anteater Drive</li>\n<li>East Peltason Drive and Bison Avenue</li>\n<li>West Peltason Drive and Mesa</li>\n<li>West Peltason Drive and Pereira </li>\n</ul>",
